import React from 'react';
import { Link } from 'react-router-dom';
import './CardSection.css';

const CardSection = ({ heading, link }) => {
  return (
    <div className="card-section">
      <h2>{heading}</h2>
      <Link to={link}>View All</Link>
    </div>
  );
};

export default CardSection;
